import React from "react";
const ProductCard = () => {
  return (
    <>
      <section id="products">
      <h1><span className="products-heading">ABOUT US</span></h1>
        <div className="container">
          <div className="row">
            <div id="products-container">
                <div className="product-content">
                    <div className="product-image">
                        <img src="../image/img1.jpg" alt="" />
                    </div>
                    <h6 style={{color:"black",fontWeight:'600'}}>MuscleBlaze Protien Bar-  III</h6>
                    <p  style={{color:'grey',fontWeight:'600',marginBottom:'0'}}>Shipped in 3-4 days</p>
                    <span style={{color:"black",fontWeight:'600'}}>$35.22</span>
                    .products
                </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default ProductCard;
